column8:
1.日本初・自動車設置可能な液体消火器<Br>
　120℃の耐火試験の結果、100℃の環境でも何ら問題なく消火液を噴射することが実証されました。<Br>
<Br>
2.人や環境にやさしい<Br>
　この消火液は、人体や動植物に対してもアタック性が非常に低く、99%以上自然分解いたしますので
　そのまま流しても問題ありません。<Br>
<Br>
3.使用範囲<Br>
　このスプレーは特殊なパウチ構造により上向きでも下向きでも360度どんな状態でも確実に噴射します。<Br>
<Br>
4.長期保存が可能<Br>
　通常の簡易消火器の交換時期は2～3年ですが、この消火具は特殊4層パウチ（袋）に包まれており
　容器の腐食、溶剤の変質の心配が無くとても安全性が高い構造になっているため、
　長期保存が可能になりました。<Br>
<Br>
5.消火後の後始末<Br>
　通常の泡状消火器と違い、水に近い液体タイプですので噴射後の後始末が簡単です。<Br><Br>

※ラジエターなど冷却装置の緊急時に冷却剤として使用することもできます。<style type="text/css">
